import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <p>
          What is the Barname? <br/>
          <input type = "text" id="myText" value="Barname"/>
        </p>     
       </header>
    </div>
  );
}

export default App;
